import React, { Fragment } from 'react';
import classes from './Header.module.css';

const Header = (props) => {
	return (
		<Fragment>
			<header className={classes['main-header']}>
				<nav className={classes['header-nav']}>
					<ul className={classes['header-nav__items']}>
						<li className={classes['header-nav__item']}>HOME</li>
						<li className={classes['header-nav__item']}>MENU</li>
						<li className={classes['header-nav__item']}>DESIGN</li>
						<li className={classes['header-nav__item']}>CONTACT US</li>
					</ul>
				</nav>
			</header>
		</Fragment>
	);
};

export default Header;
